import React from 'react';

// Se removió la importación de 'lucide-react' para evitar el error de "Module not found".
// Los íconos ahora son SVGs en línea.

function Contacto({ setSelectedGame }) {

    // Componentes de Ícono SVG en línea (equivalentes a Lucide React)
    const MailIcon = (props) => (
        <svg {...props} xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"><rect width="20" height="16" x="2" y="4" rx="2"/><path d="m22 7-8.97 5.7a1.94 1.94 0 0 1-2.06 0L2 7"/></svg>
    );

    const UserIcon = (props) => (
        <svg {...props} xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"><path d="M19 21v-2a4 4 0 0 0-4-4H9a4 4 0 0 0-4 4v2"/><circle cx="12" cy="7" r="4"/></svg>
    );

    const PhoneIcon = (props) => (
        <svg {...props} xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"><path d="M22 16.92v3a2 2 0 0 1-2.18 2 19.79 19.79 0 0 1-8.63-3.07 19.5 19.5 0 0 1-6-6 19.79 19.79 0 0 1-3.07-8.63A2 2 0 0 1 4.08 2h3a2 2 0 0 1 2 1.72 17 17 0 0 0 .54 2.14 2 2 0 0 1-.39 2.06l-2.73 2.73a17.43 17.43 0 0 0 6.2 6.2l2.73-2.73a2 2 0 0 1 2.06-.39 17 17 0 0 0 2.14.54A2 2 0 0 1 22 16.92z"/></svg>
    );

  return (
    <div className="flex items-center justify-center min-h-screen bg-gray-100 p-4 sm:p-6">
        
        {/* Contenedor principal estilo tarjeta */}
        <div className="bg-white p-6 sm:p-10 rounded-xl shadow-2xl w-full max-w-xl">
            
            {/* Botón de Regreso */}
            <button 
                className="mb-6 flex items-center text-blue-600 hover:text-blue-800 transition duration-150"
                onClick={() => setSelectedGame('home')}
            >
                ⬅️ Regresar al Menú
            </button>
            
            <h1 className="flex items-center text-3xl sm:text-4xl font-extrabold text-gray-900 border-b-4 border-blue-500 pb-3 mb-6">
                <MailIcon className="w-8 h-8 mr-3 text-blue-500" />
                Contacto
            </h1>
            
            <p className="text-base sm:text-lg text-gray-600 leading-relaxed mb-8">
                Valoramos tu comunicación. Si tienes sugerencias, comentarios sobre los juegos, 
                o encuentras algún error, no dudes en contactarme. Tu opinión es esencial para mejorar MI-ARCADE-WEB.
            </p>
            
            {/* Bloque de Información de Contacto */}
            <div className="space-y-6">
                <h2 className="text-xl sm:text-2xl font-semibold text-blue-700 mb-4 border-l-4 border-blue-300 pl-3">Detalles del Editor</h2>
                
                {/* Nombre */}
                <div className="flex items-start p-4 bg-blue-50 rounded-lg">
                    <UserIcon className="w-6 h-6 text-blue-500 mt-0.5 flex-shrink-0" />
                    <div className="ml-4">
                        <p className="text-sm font-medium text-gray-700">Nombre</p>
                        <p className="text-lg font-bold text-gray-900">Jonathan Jesús Lorenzana Lemus</p>
                    </div>
                </div>

                {/* Correo Electrónico */}
                <div className="flex items-start p-4 bg-green-50 rounded-lg">
                    <MailIcon className="w-6 h-6 text-green-500 mt-0.5 flex-shrink-0" />
                    <div className="ml-4">
                        <p className="text-sm font-medium text-gray-700">Correo Electrónico</p>
                        <a 
                            href="mailto:l3musj3sus@gmail.com" 
                            className="text-lg font-bold text-green-600 hover:text-green-700 transition duration-150"
                        > 
                            l3musj3sus@gmail.com
                        </a>
                    </div>
                </div>

                {/* Teléfono */}
                <div className="flex items-start p-4 bg-yellow-50 rounded-lg">
                    <PhoneIcon className="w-6 h-6 text-yellow-500 mt-0.5 flex-shrink-0" />
                    <div className="ml-4">
                        <p className="text-sm font-medium text-gray-700">Teléfono</p>
                        <p className="text-lg font-bold text-gray-900">98013702 (Sólo para asuntos importantes o de negocio)</p>
                    </div>
                </div>
            </div>

            <p className="mt-8 text-sm text-gray-500 italic text-center">
                Intentaremos responder a todos los correos en un plazo de 48 horas.
            </p>
        </div>
    </div>
  );
}

export default Contacto;
